import React from 'react'
import DataGrid from 'react-data-grid';

const columns = [
  { key: 'id', name: 'ID' },
  { key: 'title', name: 'Title' }
];

const rows = [
  { id: 0, title: 'Example' },
  { id: 1, title: 'Demo3' },
  { id: 2, title: 'Example3' },
  { id: 3, title: 'Demo3' },
  { id: 4, title: 'Example3' },
  { id: 5, title: 'Demo3' }
];

const LandlordList = () => {
    return (
        <div>
            <DataGrid columns={columns} rows={rows} />;
        </div>
    )
}

export default LandlordList
